sys_variable_value.value:
(function execute(inputs, outputs) {
var article = inputs.article_name;

 var r = new sn_ws.RESTMessageV2('x_snc_plants_db.Wikipedia', 'GET Page Content');
 r.setStringParameterNoEscape('article', article);
 var response = r.execute();
 var responseBody = response.getBody();
 var httpStatus = response.getStatusCode();

outputs.http_status = httpStatus;
outputs.body = responseBody;
})(inputs, outputs);

